class Solution:
    def _lengthOfLongestSubstring(self, s: str) -> int:
        # 暴力循环
        if not s:
            return 0
        if len(s) == 1:
            return 1
        sub = []
        lengths = []
        for index, value in enumerate(s):
            sub = [value]
            if index >= len(s) - 1:
                break
            for in_value in s[index+1:]:
                if in_value not in sub:
                    sub.append(in_value)
                else:
                    break
            lengths.append(len(sub))
        return max(lengths)

    def __lengthOfLongestSubstring(self, s: str) -> int:
        # 滑动窗口
        max_length = 0
        start = 0
        char_dict = {}
        for i, char in enumerate(s):
            if char in char_dict and start <= char_dict[char]:
                start = char_dict[char] + 1
            else:
                max_length = max(max_length, i - start + 1)
            char_dict[char] = i
        return max_length

    def lengthOfLongestSubstring(self, s: str) -> int:
        # 滑动窗口, 更少内存更形象
        window = ""
        max_length = 0
        for i in s:
            if i not in window:
                window += i
                max_length = max(max_length, len(window))
            else:
                window += i
                window = window.split(i, 1)[-1]

        return max_length



